CREATE TABLE vendors (vendor_id TEXT PRIMARY KEY, name TEXT);
CREATE TABLE devices (vendor_id TEXT, device_id TEXT, name TEXT,
               PRIMARY KEY(vendor_id, device_id));
CREATE TABLE subsystems (vendor_id TEXT, device_id TEXT, subvendor_id TEXT, subdevice_id TEXT, name TEXT,
               PRIMARY KEY(vendor_id, device_id, subvendor_id, subdevice_id));

